import React from "react";
import styled from "styled-components";

const Box = styled.div`
display: flex; /* Flexbox로 설정 */
  align-items: flex-start;
width: 1040px;
height: 100%

border: 1px solid black;
  box-sizing: border-box;
`;

const Image = styled.div`
  height: 250px;
  width: 250px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Info = styled.div`
  height: 790px;
  width: 1040px;
`;

const NameText = styled.div`
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
  margin-top: 10px;
  margin-bottom: 10px;

  border: 1px solid black;
  box-sizing: border-box;
`;

const Text = styled.div`
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 24px;
  font-style: normal;
  font-weight: 400;
  line-height: 40px;

  border: 1px solid black;
  box-sizing: border-box;
`;

export default function MyInfo() {
  return (
    <Box>
      <Image></Image>

      <Info>
        <NameText>임세연</NameText>
        <Text>ㅇㅇ 대학교</Text>
        <Text>2002.12.02</Text>
        <Text>iteyeonn@gmail.com</Text>
        <Text>github 주소</Text>
      </Info>
    </Box>
  );
}
